export default function CustomSelect({ name, onSelect, label, children }) {
  function handleSelect(e) {
    onSelect(name, e.target.value);
  }

  return (
    <div>
      <label htmlFor={name}>{label}</label>
      <select id={name} name={name} onChange={onSelect}>
        {children}
      </select>
    </div>
  );
}
